const SvgComponent = (props) => {
    switch (props.name) {
        case 'Destination':
            return <DestinationIcon />;
        case 'Activities':
            return <ActivitiesIcon />;
        case 'Hotel':
            return <HotelIcon />;
        case 'Restaurant':
            return <RestaurantIcon />;
        case 'QRCode':
            return <QRCodeIcon />;
        case 'Search':
            return <SearchIcon />;
        case 'StarSmall0':
            return <StarIcon color="#FFC107" size="14" />;
        case 'StarSmall1':
            return <StarIcon color="#fff" size="14" />;
        case 'StarBig0':
            return <StarIcon color="#FFC107" size="20" />;
        case 'StarBig1':
            return <StarIcon color="#fff" size="20" />;
        case 'BackArrow':
            return <BackArrowIcon />;
        case 'ThreeDots':
            return <ThreeDotsIcon />;
        case 'Clock':
            return <ClockIcon size="40" />;
        case 'Location':
            return <LocationIcon size="40" />;
        case 'UserVerification':
            return <UserVerificationIcon size="40" />;
        case 'Reputation':
            return <ReputationIcon size="40" />;
        case 'Ticket':
            return <TicketIcon size="40" />;
        case 'Blockchain':
            return <BlockchainIcon size="40" />;
        case 'Heart0':
            return <Heart0Icon size="25" />;
        case 'Heart1':
            return <Heart1Icon size="25" />;
        default:
            return <DestinationIcon />;
    }
}

export default SvgComponent;